description:
Verenigde Staten
Komedie / Romantiek
103 minuten

een goeie en mooie film

met America Ferrera, Forest Whitaker en Regina King

Een jonge Afro-Amerikaan en zijn Latijns-Amerikaanse vriendin willen gaan trouwen, om daarna naar Laos te vertrekken voor Artsen 
Zonder Grenzen. Het enige probleem is beide families. Zij moeten hun culturele verschillen en persoonlijke vetes terzijde leggen 
om het huwelijk van het koppel in minder dan twee weken te plannen.
